import React, { useState, useEffect } from "react";

const Component1 = () => {
  const [data, setData] = useState();

  useEffect(() => {
    fetch("localhost:8080/part?id=0")
      .then((res) => res.json())
      .then((json) => setData(json));
  }, []);

  console.log({ data });

  return <div>Component1</div>;
};

export default Component1;
